import React from "react";
import "./ShipNPay.scss";

const ShipNPay = () => {
  return (
    <div className="ShipNPay">
      <div className="title1">Shipping and Payment</div>
      <div className="login">
        <span className="log">LOG IN</span>
        <span className="sign">SIGN UP</span>
      </div>
      <div className="info">
        <span className="title">Shipping information</span>
      </div>
    </div>
  );
};

export default ShipNPay;
